import './Listproduct.css'

function Listproduct(){
    return(
        <>
        <div className='list'>
            <div className='icon'>Gambar</div>
            <div className='nama-produk'>Nama</div>
            <div className='jumlah'>Jumlah</div>
            <div className='harga'>harga satuan</div>
        </div>
        </>
    )
}
export default Listproduct;
